import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButtons, IonButton, IonIcon, IonBackButton } from '@ionic/react';
import React from 'react';
import QRComponent from '../components/QRComponent';
import './QRPage.css';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>


      <IonToolbar>
    <IonButtons slot="secondary">
      <IonButton fill="outline">
        <IonIcon slot="start" name="star" />
        Star
      </IonButton>
    </IonButtons>
    <IonTitle>Outline Buttons</IonTitle>
    <IonButtons slot="primary">
      <IonButton color="danger" fill="outline">
        Edit
        <IonIcon slot="end" name="create" />
      </IonButton>
    </IonButtons>
  </IonToolbar>


      </IonHeader>
      <IonContent>
        <QRComponent />
      </IonContent>
    </IonPage>
  );
};

export default Home;
